import clsx from 'clsx';
import React from 'react';
import {
	cardDifficultyContainer,
	difficultyContainer
} from '../../../styles/styles';

const Difficulty = (difficulty) => {
	difficulty = 'Easy';
	console.log(
		clsx('{ cardDifficultyContainer }', 'border-[#168914]', 'bg-[#04B100]')
	);

	switch (difficulty) {
		case 'Easy':
			return (
				<div
					className={clsx(
						{ cardDifficultyContainer },
						'border-[#168914]',
						'bg-[#04B100]'
					)}
				></div>
			);
			break;
	}
};

export default Difficulty;
